import React from "react";

function Index() {
    const getCategories = ()=>{
        Axios.get()
    }
  return (
    <div>
      {/* Button div */}
      <div>
        <button>PREV</button>
        <button>NEXT</button>
        <select>
          <option>Select category</option>
        </select>
      </div>
      {/* Img div */}
      <div></div>
      <div></div>
    </div>
  );
}

export default Index;
